package ra.dev.model.dto.request.user;import lombok.Data;import lombok.NoArgsConstructor;@Data@NoArgsConstructorpublic class UserList {    private Integer userId;    private String userName;    private String fullName;    private String phoneNumber;    private String email;    private String address;    public UserList(Integer userId, String userName, String fullName, String phoneNumber, String email, String address) {        this.userId = userId;        this.userName = userName;        this.fullName = fullName;        this.phoneNumber = phoneNumber;        this.email = email;        this.address = address;    }}